import React from "react";
import { Login } from "react-icons/bs";

const UserCard = ({ nombre, apellido }) => {
  return (
    <div className=" flex fixed top-32">
      <h1 className=" text-2xl font-[Dosis]">{nombre} </h1>
      <h1 className=" text-2xl font-[Dosis]">{apellido}</h1>
    </div>
  );
};

export default UserCard;
